   //\u70b9\u51fb\u4e86\u62d2\u7edd\u6388\u6743\u540e--\u5c31\u4e00\u76f4\u4f1a\u8fdb\u5165\u5931\u8d25\u56de\u8c03\u51fd\u6570--\u6b64\u65f6\u5c31\u53ef\u4ee5\u5728\u8fd9\u91cc\u91cd\u65b0\u62c9\u8d77\u6388\u6743\u7a97\u53e3\n                console.log('\u62d2\u7edd\u6388\u6743', error)\n\n                uni.showModal({\n                  title: '\u63d0\u793a',\n                  content: '\u82e5\u70b9\u51fb\u4e0d\u6388\u6743\uff0c\u5c06\u65e0\u6cd5\u4f7f\u7528\u4f4d\u7f6e\u529f\u80fd',\n                  cancelText: '\u4e0d\u6388\u6743',\n                  cancelColor: '#999',\n                  confirmText: '\u6388\u6743',\n                  confirmColor: '#f94218',\n                  success (res) {\n                    console.log(res)\n                    if (res.confirm) {\n                      // \u9009\u62e9\u5f39\u6846\u5185\u6388\u6743\n                      uni.openSetting({\n                        success (res) {\n                          console.log(res.authSetting)\n                        }\n                      })\n                    } else if (res.cancel) {\n                      // \u9009\u62e9\u5f39\u6846\u5185 \u4e0d\u6388\u6743\n                      console.log('\u7528\u6237\u70b9\u51fb\u4e0d\u6388\u6743')\n                    }\n                  }\n                })\n              }\n            })\n          } else {\n            // \u6709\u6743\u9650\u5219\u76f4\u63a5\u83b7\u53d6\n            uni.getLocation({\n              type: 'wgs84',\n              success: function (res) {\n                that.x = res.longitude\n                that.y = res.latitude\n                console.log(res)\n                console.log('\u5f53\u524d\u4f4d\u7f6e\u7684\u7ecf\u5ea6\uff1a' + res.longitude)\n                console.log('\u5f53\u524d\u4f4d\u7f6e\u7684\u7eac\u5ea6\uff1a' + res.latitude)\n                uni.showToast({\n                  title: '\u5f53\u524d\u4f4d\u7f6e\u7684\u7ecf\u7eac\u5ea6\uff1a' + res.longitude + ',' + res.latitude,\